import React, { useEffect, useState } from "react";
import apiMock from "../../Api"
import { MyTeamStyle } from './styles'
import SideBar from "../../Components/SideBar";
import campo from "../../imagens/campo.png";


interface Jogador {
    nome: string;
    idade: number;
    nacionalidade: string;
    clube: string;
    posicao: string;
    overall: number;
    foto: string;
    id: number;
}

function MyTeam() {

    const [jogadores, setJogadores] = useState<Jogador[]>();

    async function GetJogadores() {
        try {
            const res = await apiMock.get<Jogador[], any>("/jogadores");
            setJogadores(res.data);
            console.log(jogadores);
        } catch (err) {
            console.log(err)
        }
    }


    useEffect(() => {
        GetJogadores();
    }, []);

    return (
        <>
            <SideBar selected="myteam" />
            <MyTeamStyle>
                <div className="container">

                    <div className="jogadores">

                        {jogadores && jogadores.map((jogador) => (

                            <div className="jogador">
                                <div className="foto"><img src="" alt="" /></div>
                                <ul>
                                    <li>Nome: <span>{jogador.nome}</span></li>
                                    <li>Posição: <span>{jogador.posicao}</span></li>
                                    <li>Overall: </li>
                                </ul>
                            </div>

                        ))}

                    </div>




                    <div className="campo"><img src={campo} alt="" /></div>
                </div>
            </MyTeamStyle>
        </>
    );
}

export default MyTeam;
